import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the first product card using a unique product title text
    const firstProductTitle = "Apple iPhone 15 Pro Max, 256GB, Natural Titanium";
    const productCard = await page.waitForSelector(`.product-card:has-text("${firstProductTitle}")`, { timeout: 5000 });

    // Within the first product card, find the "Add to Cart" button using its text and class
    const addToCartBtn = await productCard.waitForSelector('button.add-to-cart', { timeout: 5000 });

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Take screenshot after adding to cart
    const afterAddShot = path.join(screenshotsDir, 'step_2_after_add_to_cart.png');
    await page.screenshot({ path: afterAddShot });
    screenshots.push(afterAddShot);

    // Wait for notification to appear (success message)
    const notification = await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Extract notification text
    const notificationText = await notification.innerText();

    // Extract cart count from cart indicator (look for .cart or #cartCount)
    let cartCount = null;
    try {
      // Try #cartCount first
      const cartCountElem = await page.waitForSelector('#cartCount', { timeout: 5000 });
      cartCount = await cartCountElem.innerText();
    } catch {
      // Fallback: try to extract number from .cart div
      const cartDiv = await page.waitForSelector('.cart', { timeout: 5000 });
      const cartText = await cartDiv.innerText();
      const match = cartText.match(/\d+/);
      cartCount = match ? match[0] : null;
    }

    // Return result
    return {
      success: true,
      action: "Added the first product (Apple iPhone 15 Pro Max) to cart and verified notification and cart count.",
      extractedData: {
        notificationText,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
